import "css/main.css";

export default function Header() {
  return (
    <header className="header">
          <div className="wrap">
              <h2>Beleza</h2>
              <h1>
                <a href="#">
                  <img src="/images/propz-logo.svg" />
                </a>
              </h1>
          </div>               
    </header>
  );
}
